import React, { useState, useEffect } from 'react';
import { Grid, Card, CardContent, CardMedia, Typography, TextField, Box, Select, MenuItem, FormControl, InputLabel, Pagination } from '@mui/material';
import { User } from '../types/User';
import axios from 'axios';

const PEXELS_API_KEY = 'mIFzGvoWn6QuExlYm7tvsJDagoQLvzv9DJwiM5B2pzyaaCvPw46AFsQk';

// Function to determine likely gender based on first name
const getGenderFromName = (name: string): 'male' | 'female' => {
    const firstName = name.split(' ')[0].toLowerCase();
    // Common female name endings and specific names
    const femaleIndicators = ['a', 'na', 'ia', 'lia', 'emma', 'sarah', 'jane', 'maria', 'sophie', 'jennifer', 'anna', 'julia', 'nina', 'isabella', 'lisa'];

    // Check if the name matches any female indicators
    if (femaleIndicators.some(indicator => 
        firstName === indicator || firstName.endsWith(indicator)
    )) {
        return 'female';
    }

    return 'male'; // Default to male if no female indicators are found
};

// Mock data - replace with actual API call in production
const mockUsers: User[] = [
    { id: 1, name: 'John Doe', team: 'Engineering', location: 'New York', jobRole: 'Software Engineer', imageUrl: '' },
    { id: 2, name: 'Jane Smith', team: 'Design', location: 'San Francisco', jobRole: 'UI Designer', imageUrl: '' },
    { id: 3, name: 'Mike Johnson', team: 'Marketing', location: 'London', jobRole: 'Marketing Manager', imageUrl: '' },
    { id: 4, name: 'Sarah Williams', team: 'Engineering', location: 'Berlin', jobRole: 'Frontend Developer', imageUrl: '' },
    { id: 5, name: 'Tom Brown', team: 'Product', location: 'Toronto', jobRole: 'Product Manager', imageUrl: '' },
    { id: 6, name: 'Emily Davis', team: 'Engineering', location: 'Sydney', jobRole: 'Backend Developer', imageUrl: '' },
    { id: 7, name: 'David Wilson', team: 'Design', location: 'Paris', jobRole: 'UX Designer', imageUrl: '' },
    { id: 8, name: 'Lisa Anderson', team: 'Marketing', location: 'Tokyo', jobRole: 'Content Strategist', imageUrl: '' },
    { id: 9, name: 'James Taylor', team: 'Product', location: 'Singapore', jobRole: 'Product Owner', imageUrl: '' },
    { id: 10, name: 'Maria Garcia', team: 'Engineering', location: 'Madrid', jobRole: 'DevOps Engineer', imageUrl: '' },
    { id: 11, name: 'Robert Martinez', team: 'Design', location: 'Barcelona', jobRole: 'Visual Designer', imageUrl: '' },
    { id: 12, name: 'Jennifer Lee', team: 'Marketing', location: 'Seoul', jobRole: 'Digital Marketing Manager', imageUrl: '' },
    { id: 13, name: 'William Chen', team: 'Engineering', location: 'Shanghai', jobRole: 'Mobile Developer', imageUrl: '' },
    { id: 14, name: 'Sophie Martin', team: 'Product', location: 'Amsterdam', jobRole: 'Product Analyst', imageUrl: '' },
    { id: 15, name: 'Daniel Kim', team: 'Engineering', location: 'Vancouver', jobRole: 'Security Engineer', imageUrl: '' },
    { id: 16, name: 'Emma Thompson', team: 'Design', location: 'Melbourne', jobRole: 'Motion Designer', imageUrl: '' },
    { id: 17, name: 'Lucas Silva', team: 'Marketing', location: 'S達o Paulo', jobRole: 'Brand Manager', imageUrl: '' },
    { id: 18, name: 'Anna Kowalski', team: 'Engineering', location: 'Warsaw', jobRole: 'QA Engineer', imageUrl: '' },
    { id: 19, name: 'Mohammed Ahmed', team: 'Product', location: 'Dubai', jobRole: 'Product Strategy Lead', imageUrl: '' },
    { id: 20, name: 'Julia M端ller', team: 'Design', location: 'Munich', jobRole: 'Interaction Designer', imageUrl: '' },
    { id: 21, name: 'Alex Petrov', team: 'Engineering', location: 'Moscow', jobRole: 'Systems Architect', imageUrl: '' },
    { id: 22, name: 'Isabella Romano', team: 'Marketing', location: 'Rome', jobRole: 'Social Media Manager', imageUrl: '' },
    { id: 23, name: 'Thomas Anderson', team: 'Product', location: 'Stockholm', jobRole: 'Data Analyst', imageUrl: '' },
    { id: 24, name: 'Nina Patel', team: 'Engineering', location: 'Mumbai', jobRole: 'Cloud Engineer', imageUrl: '' },
    { id: 25, name: 'Carlos Rodriguez', team: 'Design', location: 'Mexico City', jobRole: 'Art Director', imageUrl: '' }
];

const ITEMS_PER_PAGE = 20;

const UserList: React.FC = () => {
    const [users, setUsers] = useState<User[]>([]);
    const [filteredUsers, setFilteredUsers] = useState<User[]>([]);
    const [searchTerm, setSearchTerm] = useState('');
    const [teamFilter, setTeamFilter] = useState('');
    const [locationFilter, setLocationFilter] = useState('');
    const [roleFilter, setRoleFilter] = useState('');
    const [page, setPage] = useState(1);

    const teams = Array.from(new Set(mockUsers.map(user => user.team)));
    const locations = Array.from(new Set(mockUsers.map(user => user.location)));
    const roles = Array.from(new Set(mockUsers.map(user => user.jobRole)));

    useEffect(() => {
        const fetchUserImages = async () => {
            const usersWithImages = await Promise.all(
                mockUsers.map(async (user) => {
                    try {
                        const gender = getGenderFromName(user.name);
                        const searchTerms = gender === 'female' 
                            ? [
                                'businesswoman portrait professional',
                                'female executive headshot',
                                'professional woman portrait',
                                'female business profile'
                              ]
                            : [
                                'businessman portrait professional',
                                'male executive headshot',
                                'professional man portrait',
                                'male business profile'
                              ];

                        const randomTerm = searchTerms[Math.floor(Math.random() * searchTerms.length)];

                        const response = await axios.get(
                            `https://api.pexels.com/v1/search?query=${encodeURIComponent(randomTerm)}&per_page=15&orientation=portrait`,
                            {
                                headers: {
                                    'Authorization': PEXELS_API_KEY
                                }
                            }
                        );

                        const photos = response.data.photos;
                        const randomPhoto = photos[Math.floor(Math.random() * photos.length)];

                        return { 
                            ...user, 
                            imageUrl: randomPhoto?.src?.medium || 'https://via.placeholder.com/200'
                        };
                    } catch (error) {
                        console.error('Error fetching image:', error);
                        return user;
                    }
                })
            );
            setUsers(usersWithImages);
            setFilteredUsers(usersWithImages);
        };

        fetchUserImages();
    }, []);

    useEffect(() => {
        let filtered = users;

        if (searchTerm) {
            filtered = filtered.filter(user =>
                user.name.toLowerCase().includes(searchTerm.toLowerCase())
            );
        }

        if (teamFilter) {
            filtered = filtered.filter(user => user.team === teamFilter);
        }

        if (locationFilter) {
            filtered = filtered.filter(user => user.location === locationFilter);
        }

        if (roleFilter) {
            filtered = filtered.filter(user => user.jobRole === roleFilter);
        }

        setFilteredUsers(filtered);
        setPage(1); // Reset to first page when filters change
    }, [searchTerm, teamFilter, locationFilter, roleFilter, users]);

    const handlePageChange = (event: React.ChangeEvent<unknown>, value: number) => {
        setPage(value);
    };

    const paginatedUsers = filteredUsers.slice(
        (page - 1) * ITEMS_PER_PAGE,
        page * ITEMS_PER_PAGE
    );

    return (
        <Box sx={{ p: 3 }}>
            <Box sx={{ mb: 4 }}>
                <Grid container spacing={2}>
                    <Grid item xs={12} sm={3}>
                        <TextField
                            fullWidth
                            label="Search by name"
                            value={searchTerm}
                            onChange={(e) => setSearchTerm(e.target.value)}
                        />
                    </Grid>
                    <Grid item xs={12} sm={3}>
                        <FormControl fullWidth>
                            <InputLabel>Team</InputLabel>
                            <Select
                                value={teamFilter}
                                label="Team"
                                onChange={(e) => setTeamFilter(e.target.value)}
                            >
                                <MenuItem value="">All</MenuItem>
                                {teams.map(team => (
                                    <MenuItem key={team} value={team}>{team}</MenuItem>
                                ))}
                            </Select>
                        </FormControl>
                    </Grid>
                    <Grid item xs={12} sm={3}>
                        <FormControl fullWidth>
                            <InputLabel>Location</InputLabel>
                            <Select
                                value={locationFilter}
                                label="Location"
                                onChange={(e) => setLocationFilter(e.target.value)}
                            >
                                <MenuItem value="">All</MenuItem>
                                {locations.map(location => (
                                    <MenuItem key={location} value={location}>{location}</MenuItem>
                                ))}
                            </Select>
                        </FormControl>
                    </Grid>
                    <Grid item xs={12} sm={3}>
                        <FormControl fullWidth>
                            <InputLabel>Role</InputLabel>
                            <Select
                                value={roleFilter}
                                label="Role"
                                onChange={(e) => setRoleFilter(e.target.value)}
                            >
                                <MenuItem value="">All</MenuItem>
                                {roles.map(role => (
                                    <MenuItem key={role} value={role}>{role}</MenuItem>
                                ))}
                            </Select>
                        </FormControl>
                    </Grid>
                </Grid>
            </Box>

            <Grid container spacing={3}>
                {paginatedUsers.map((user) => (
                    <Grid item xs={12} sm={6} md={4} lg={3} key={user.id}>
                        <Card sx={{ height: '100%' }}>
                            <CardMedia
                                component="img"
                                height="200"
                                image={user.imageUrl || 'https://via.placeholder.com/200'}
                                alt={user.name}
                            />
                            <CardContent>
                                <Typography variant="h6" component="div">
                                    {user.name}
                                </Typography>
                                <Typography color="text.secondary">
                                    {user.team}
                                </Typography>
                                <Typography color="text.secondary">
                                    {user.location}
                                </Typography>
                                <Typography color="text.secondary">
                                    {user.jobRole}
                                </Typography>
                            </CardContent>
                        </Card>
                    </Grid>
                ))}
            </Grid>

            {filteredUsers.length > ITEMS_PER_PAGE && (
                <Box sx={{ mt: 4, display: 'flex', justifyContent: 'center' }}>
                    <Pagination 
                        count={Math.ceil(filteredUsers.length / ITEMS_PER_PAGE)} 
                        page={page} 
                        onChange={handlePageChange}
                        color="primary"
                        size="large"
                    />
                </Box>
            )}
        </Box>
    );
};

export default UserList;
